// import logo from './logo.svg';
import './App.css';
import Form from './components/Form'
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import MainDash from './componentszzzzzzzzzzzzzz/MainDash';

function App() {
  return (
    <div className="App">
         <Form/>
      {/* <Form/> */}
      <Router>


      <Routes>
     <Route exact path ='/Form' element={<Form/>} components={<Form/>} />
     <Route exact path='/MainDash' element={<MainDash/>} components={<MainDash/>}/>
      </Routes>
    </Router>
    </div>
  );
}

export default App;
